import React from "react";
import ReactDOM from "react-dom";
import {useState} from "react";

function newNote() {
  return (
    <div className="note1">
    <form >
    <input type="text" id="inputTitle" /><br />
    <input type="text" id="inputContent"/>
    </form>
    </div>
  );
}
export default newNote;
